map.addMarkers(markers);
var idIndex = -1
var hoverIndex = 0;
function myClick(){
	console.log("before: " + idIndex)
	console.log("before: " + hoverIndex)
	//Move To FirstMarker if nothing happened so far
	if(idIndex == -1){
		console.log("this should just trigger ONCE")
		var element = document.getElementById("title")
		element.innerHTML = markers[0].title
		map.markers[0].setIcon('assets/img/marker_green.png')
		map.setCenter(markers[0].lat,markers[0].lng)
		idIndex = 0
	}
	console.log("after: " + idIndex)
	console.log("after: " + hoverIndex)
	if(hoverIndex == 2){
		hoverIndex = 0
		idIndex+=1

		console.log(markers[idIndex]);
		map.markers[idIndex-1].setIcon('assets/img/blank.png')
		map.markers[idIndex].setIcon('assets/img/marker_green.png')
		var element = document.getElementById("title")
		element.innerHTML= markers[idIndex].title
		map.setCenter(markers[idIndex].lat, markers[idIndex].lng)
	}else{
		//Move Through the different options (e.g. ImageHide on hoverIndex0; Image Show on hoverImage1; go to next on hoverImage2)
		var element = document.getElementById("imgParent")
 			switch(hoverIndex){
 				case 0:
 					element.innerHTML = markers[idIndex].infoWindow.content
 					break;
 				case 1:
 					element.innerHTML = ""
 					break;
 				case 2:
 					console.log("you shoulndt be here right now ._.")
 					break;
 			}
  			hoverIndex += 1
	}

}







